import React from 'react';
import ReactDOM from 'react-dom';
import Heading from "./Heading";


ReactDOM.render(
  <>
  <Heading />
  <p>This is my world</p>

  <ol>
  <li>Arbaaz</li>
  <li>Khan</li>
  <li>Mansoor</li>

  </ol>

  </>,
  document.getElementById("root")
);
